dots=clamp(pow(dots,5.0*uS),0.2,1.0);
tex.rgb*=dots;

float strength = 24.0;
float x = (uv.x+4.0)*(uv.y+4.0)*hash12(vec2(floor(uv.x+uv2.y*2048.0),floor(uv.y+uv2.x*2048.0)));
vec3 grain=1.0-vec3(mod((mod(x,13.0)+1.0)*(mod(x,123.0)+1.0),0.01)-0.005)*strength;
tex*=grain;
gl_FragColor=vec4(tex,1.0);
}
